import seriesData from "../../db/seriesData";
import "./style.css";

const SeriesList = () => {
  return (
    <ul className="series">
      {seriesData.map(({ title, character, cover, html, year }, index) => {
        return (
          <li key={index}>
            <h4>{title}</h4>
            <a href={html} target="_blank" rel="noreferrer">
              <img src={require({ cover })} key={index} alt={title}></img>
            </a>
            <p>
              {character}, {year}
            </p>
          </li>
        );
      })}
    </ul>
  );
};
export default SeriesList;
